// JavaScript Document

import React, { Component } from 'react';


function Header() {
  return (
    <header>
	  <div className="container-fluid">
	  <div className="row">
		  <div className="logo">Logo</div>

		  <nav>
			<ul>
				<li className="first"><a href="/">Home</a></li>
				<li><a href="/">Art</a></li>
				<li className="last"><a href="/">Contact</a></li>
			</ul>

		  </nav>
       </div>
    </div>
    </header>
  );
}

export default Header;
